import React, { Component } from 'react';
import Papa from 'papaparse';
import './App.css';
import { Button, Grid, Header, Input } from 'semantic-ui-react'
import 'semantic-ui-css/semantic.min.css'




class App extends Component {
  state = {
    comFile: null,
    selection: null,
    agn: "",
    z: "",
    n: "",
    nh: "",
    r: ""
  }

  submitButton = () => {

  }

  handleChange = (e) => {
    let newState = {...this.state}
    // newState[e.target.label.toLowerCase()] = e.target.value
    // this.setState(newState)
    // console.log(newState)
  }

  componentDidMount() {
    Papa.parse("combinedFile.csv", {
	download: true,
	complete: (results) => {
          this.setState({...this.state, comFile: results})
	     }
    })
  }

  render() {
    return (
      <Grid container columns={3} divided relaxed stackable style={{"paddingTop": "30px"}}>
        <Grid.Column textAlign='center'>
        <Header as='h3' >
      Input Form
      </Header>
      <Input label='AGN' value={this.state.agn} onChange={this.handleChange} placeholder='' style={{padding: "5px"}}/>
      <br/>
      <Input label='Z' value={this.state.z} onChange={this.handleChange} placeholder='' style={{padding: "5px"}}/>
      <br/>
      <Input label='N' value={this.state.n} onChange={this.handleChange} placeholder='' style={{padding: "5px"}}/>
      <br/>
      <Input label='NH' value={this.state.nh} onChange={this.handleChange} placeholder='' style={{padding: "5px"}}/>
      <br/>
      <Input label='R' value={this.state.r} onChange={this.handleChange} placeholder='' style={{padding: "5px"}}/>
      <br/>
      <Button style={{margin: "5px", width: "154px", height: "37px"}}>
      Submit
      </Button>
        </Grid.Column>

        <Grid.Column textAlign='center'>
        <Header as='h3'>
      Graph
      </Header>
        </Grid.Column>
        <Grid.Column textAlign='center'>
        <Header as='h3'>
      Top 50 Brightest lines
      </Header>
        </Grid.Column>
      </Grid>
    )
  }
}

export default App;
